import React from 'react'
import styled from 'styled-components'

const Title = styled.h1`
font-size : 1.5em;
color : ${props =>props.color}
`;


class App extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render() {
        return (
            <div>
                <Title>
                    Helow
                </Title>
            </div>
        )
    }
}

export default App
